import React from "react";
import "./App.css";

function App() {
  return (
    <>
      <header>
        <h1>Chronoquiz</h1>
        <nav>
          <ul>
            <li><NavLink to="/">Home</NavLink></li>
            <li><NavLink to="/about">About</NavLink></li>
            <li><NavLink to="/login">Log In</NavLink></li>
            <li><NavLink to="/game">Play</NavLink></li>
          </ul>
        </nav>
      </header>
      <main>
        <div className="App"></div>
      </main>
    </>
  );
}

export default App;
